    function registrar(){
        // Genera Numero de Folio
        $numero_folio = mt_rand(100000, 999999);
        return view('ipdp.consulta_publica', [
            'numero_folio' => $numero_folio
        ]);

    }

    function confirmacion($numero_folio){
        // Valida que folio se componga de 6 digitos
        if( preg_match("/^[\w\d]{6}$/",$numero_folio) == false){
            abort(404);
        }

        $numero_folios_existentes = DB::table('cedulas')->where('folio',$numero_folio)->count();

        if( $numero_folios_existentes == 0 ){
            abort(404);
        }

        return view('ipdp.confirmacion', [
            'numero_folio' => $numero_folio
        ]);
    }

    public function subirArchivo( $tipo_consulta, $folio, Request $request)
    {
        
        $file_name = $request->file->getClientOriginalName();
        $extension = $request->file->getClientOriginalExtension();
        $real_path = $request->file->getRealPath();
        $size = $request->file->getSize();
        $size_mbs = ($size / 1024) / 1024;
        $mime_type = $request->file->getMimeType();
        
        if(
            $mime_type == 'image/jpeg'
            || $mime_type == 'image/jpg'
            || $mime_type == 'image/png'
            || $mime_type == 'application/pdf'
            || $mime_type == 'application/msword'
            || $mime_type == 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'
         ){

                $folder = date("Y").'/'.date("m").'/'.$folio;
                $path = Storage::disk('public')->put($folder, $request->file);

                $cedula_archivo = CedulaArchivo::create([
                    'tipo_consulta' => $tipo_consulta,
                    'folio' => $folio,
                    'file_path' => $path,
                ]);

                return response([
                    'uploadURL' => $path
                ], 201);
        }

        return response([], 400);        
    }

    public function buscarCedula(Request $request){
        
        
        $cedula = null;
        if( isset($request) AND isset($request->numero_folio) ) {
            // Valida que folio se componga de 6 digitos
            if( preg_match("/^[\w\d]{6}$/",$request->numero_folio) == false){
                abort(404);
            }
            $cedula = DB::table('cedulas')->where('folio','=',$request->numero_folio)->first();
        } elseif( isset($request) AND isset($request->correo) ) {
            $cedula = DB::table('cedulas')->where('correo','=',$request->correo)->first();
        }

        $archivos = DB::table('cedula_archivo')->where('folio','=',$request->numero_folio)->get();

        if($cedula != null){
            return view('ipdp.seguimiento_folios', [
                'numero_folio' => $cedula->folio,
                'cedula' => $cedula,
                'archivos' => $archivos
            ]);
        } else {
            abort(404);
        }
    }

    public function store(Request $request)
    {
        // echo "<pre>";
        // print_r( $request->all() );
        // exit;

        $validatedData = $request->validate([
            'folio' => 'required|digits:6',
            'nombre' => 'required',
            'primer_apellido' => 'required',
            'segundo_apellido' => 'required',
            'edad' => 'nullable|min:1|max:99',
            'ocupacion' => 'nullable',
            'genero' => ['required',Rule::in(['Masculino', 'Femenino','Otro'])],
            'correo' => 'required|email|unique:cedulas',
            'celular' => 'nullable|digits:10',
            'calle' => 'nullable',
            'num_exterior' => 'nullable',
            'num_interior' => 'nullable',
            'manzana' => 'nullable',
            'cp' => 'required|digits:5',
            'alcaldia' => 'required',
            'colonia' => 'nullable',
            'representante' => 'required',
            'instrumento_observar' => ['required',Rule::in(['2020-2040', '2020-2035','2020-2040,2020-2035'])],
            'comentarios' => 'required',
            'incluye_documentos' => 'required',
            'numero_documentos' => 'required|numeric|min:1|max:99',
            'conocimiento_datos_personales' => ['required',Rule::in(['si','no'])],
        ]);

        // $validatedData->genero = implode(',',$)

        $show = Cedula::create($validatedData);
        return response()->json([]);

    }

    function obtenerInstrumentosAObservar( $instrumentos ){
        $arreglo_instrumentos = explode(',',$instrumentos);
        foreach ($arreglo_instrumentos as $anio_instrumento) {
            if( $anio_instrumento == '2020-2040' ){
                $instrumento_x['periodo'] = $anio_instrumento;
                $instrumento_x['descripcion'] = "PLAN GENERAL DE DESARROLLO DE LA CIUDAD DE MÉXICO";
            } elseif( $anio_instrumento == '2020-2035' ){
                $instrumento_x['periodo'] = $anio_instrumento;
                $instrumento_x['descripcion'] = "PROGRAMA GENERAL DE ORDENAMIENTO TERRITORIAL DE LA CIUDAD DE MÉXICO";
            }
            $respuesta[] = $instrumento_x;
        }

        return $respuesta;
    }
    
