    public function obtenerColonias($codigo_postal){
        // Valida que el codigo postal sea de 5 digitos
        if( preg_match("/^[\w\d]{5}$/",$codigo_postal) == false){
            return response()->json([]);
        }

        $colonias = [];
        $ready_for_title = DB::select( DB::raw(
            'SELECT d_asenta as nombre, D_mnpio as alcaldia FROM codigo_postal WHERE d_codigo = \''.$codigo_postal.'\'') 
        );

        foreach ($ready_for_title as $colonia) {
            $tmp['nombre'] = ucwords($colonia->nombre);
            $colonias['alcaldia'] = ucwords($colonia->alcaldia);
            $colonias['colonias'][] = $tmp;
        }

        return response()->json($colonias);
    }
    
